import { jsx } from '../../scripts/scripts.js';

const lostCatText = 'data:image/jpeg;base64,';
const lostDogText = 'data:image/jpeg;base64,';
const petWatchLogo = 'data:image/png;base64,';

// Function to assign validator to input fields
function assignValidator(element, regex, message) {
  element.addEventListener('blur', () => {
    const container = element.parentElement;
    const errorMessage = container.querySelector('.error-message');
    const checkmark = container.querySelector('.checkmark');
    if (element.value !== '') {
      if (!regex.test(element.value)) {
        errorMessage.textContent = message;
        checkmark.setAttribute('style', 'opacity: 0;');
      } else {
        errorMessage.textContent = '';
        checkmark.setAttribute('style', 'opacity: 1;');
      }
    } else {
      errorMessage.textContent = '';
      checkmark.setAttribute('style', 'opacity: 0;');
    }
  });
}

export default async function decorate(block) {
  block.innerHTML = jsx`
    <div class="lost-pet-poster-generator-form">
      <p><i>*All fields are required unless marked as 'Optional'.</i></p>
      <h3>Pet details</h3>
      <div class="wrapper">
        <label for="image-file" id="#image-file-label"><div class="file-info">Upload a photo (max 2MB, supported formats: .jpg, .jpeg, .png)*</div>
          <div id="image-file-wrapper">
            <span id="fileLabel"></span>
            <input type="file" id="image-file" name="imageFile" accept="image/png, image/jpeg" required>
          </div>
        </label>
      </div>
      <div class="wrapper">
        <input type="text" id="petName" name="petName" placeholder="Pet Name" maxlength="12" required>
        <label for="petName" class="float-label">Pet name*</label>
      </div>
      <div class="wrapper flex-wrapper">
        <label>Type*</label>
        <div class="radio-wrapper">
          <input type="radio" id="speciesIdDog" name="speciesId" value="Dog" checked>
          <label for="speciesIdDog">Dog</label>
        </div>
        <div class="radio-wrapper">
          <input type="radio" id="speciesIdCat" name="speciesId" value="Cat">
          <label for="speciesIdCat">Cat</label>
        </div>
      </div>
      <div class="wrapper flex-wrapper">
        <label>Sex*</label>
        <div class="radio-wrapper">
          <input type="radio" id="speciesGenderMale" name="speciesGender" value="Male" checked>
          <label for="speciesGenderMale">Male</label>
        </div>
        <div class="radio-wrapper">
          <input type="radio" id="speciesGenderFemale" name="speciesGender" value="Female">
          <label for="speciesGenderFemale">Female</label>
        </div>
      </div>
      <div class="wrapper">
        <input type="number" id="petWeight" name="petWeight" placeholder="Weight" maxlength="3">
        <label for="petWeight" class="float-label">Weight (lbs. or kgs., optional)</label>
      </div>
      <div class="wrapper">
        <input type="text" id="petBreed" name="petBreed" placeholder="Breed" maxlength="30" required>
        <label for="petBreed" class="float-label">Breed*</label>
      </div>
      <div class="wrapper">
        <input type="number" id="petAge" name="petAge" placeholder="Age in Years" maxlength="2">
        <label for="petAge" class="float-label">Age (years, optional)</label>
      </div>
      <div class="wrapper">
        <input type="text" id="petColor" name="petColor" placeholder="Color" maxlength="30" required>
        <label for="petColor" class="float-label">Color*</label>
      </div>
      <h3>Contact information</h3>
      <div class="wrapper">
        <input type="text" id="petOwnerName" name="petOwnerName" placeholder="Owner&#39;s name" maxlength="40" required>
        <label for="petOwnerName" class="float-label">Owner&#39;s name*</label>
      </div>
      <div class="wrapper">
        <input type="number" id="phone" name="phone" placeholder="Phone" maxlength="10">
        <label for="phone" class="float-label">Phone number*</label>
        <span class="checkmark"></span>
        <div class="error-message"></div>
      </div>
      <div class="wrapper">
        <input type="email" id="email" name="email" placeholder="Email" maxlength="40" required>
        <label for="email" class="float-label">Email*</label>
        <span class="checkmark"></span>
        <div class="error-message"></div>
      </div>
      <h3>Last seen location</h3>
      <div class="wrapper">
        <input type="text" id="city" name="city" placeholder="City" maxlength="35" required>
        <label for="city" class="float-label">City*</label>
      </div>
      <div class="wrapper">
        <input type="text" id="address" name="address" placeholder="Intersection / Address" maxlength="28" required>
        <label for="address" class="float-label">Intersection / Address*</label>
      </div>
      <div class="wrapper">
        <label for="addInfo">Additional information - 200 characters max (optional):</label>
        <textarea id="addInfo" name="addInfo" placeholder="Share identifying details about your pet, or any other helpful info." maxlength="200" rows="2"></textarea>
      </div>
      <div class="wrapper wrapper-text-center">
        <button type="button" id="generatePoster">Generate Poster</button>
      </div>
    </div>
    `;
  const script = document.createElement('script');
  script.src = '/blocks/lost-pet-poster-generator/jsPDF.min.js';
  document.head.appendChild(script);

  // REGEX for validators
  const EMAIL_OPTIONAL_REGEX = /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
  const PHONE_OPTIONAL_REGEX = /^\(?(\d{3})\)?[- ]?(\d{3})[- ]?(\d{4})$/;

  // List of fields and buttons
  const generatePosterBtn = document.querySelector('#generatePoster');
  const fileInput = document.querySelector('#image-file');
  const petName = document.querySelector('#petName');
  const typeRadioGroup = document.querySelectorAll('input[type="radio"][name="speciesId"]');
  const genderRadioGroup = document.querySelectorAll('input[type="radio"][name="speciesGender"]');
  // const petWeight = document.querySelector('#petWeight');
  const petBreed = document.querySelector('#petBreed');
  const petAge = document.querySelector('#petAge');
  const petColor = document.querySelector('#petColor');
  // const petOwnerName = document.querySelector('#petOwnerName');
  const phone = document.querySelector('#phone');
  const email = document.querySelector('#email');
  const city = document.querySelector('#city');
  const address = document.querySelector('#address');
  const addInfo = document.querySelector('#addInfo');
  const fileLabel = document.querySelector('#fileLabel');
  const defaultLabelTxt = 'Choose File';
  fileLabel.textContent = defaultLabelTxt;

  // eslint-disable-next-line func-names
  fileInput.addEventListener('change', function () {
    if (this.files && this.files.length > 0) {
      fileLabel.textContent = this.files[0].name;
    } else {
      fileLabel.textContent = defaultLabelTxt;
    }
  });

  document.querySelector('.lost-pet-poster-generator-form').addEventListener('input', (event) => {
    const el = event.target;
    if (el.type === 'number') {
      el.value = el.value.replace(/[^0-9]/g, '').substring(0, el.maxLength);
    }
  });

  // Phone number validation
  assignValidator(phone, PHONE_OPTIONAL_REGEX, 'Invalid phone number. Example: (555) 555-5555.');
  assignValidator(email, EMAIL_OPTIONAL_REGEX, 'Invalid email address.');

  function getCkeckedRadioValue(radioGroup) {
    let value;
    radioGroup.forEach((radioButton) => {
      if (radioButton.checked) {
        value = radioButton.value;
      }
    });
    return value;
  }

  // PDF generation
  function generatePDF() {
    // eslint-disable-next-line new-cap
    const doc = new window.jspdf.jsPDF();
    const file = fileInput.files[0];
    const imgReader = new FileReader();

    imgReader.onloadend = (evt) => {
      const maxImageWidth = 190; // in mm
      const maxImageHeight = 80; // in mm
      // use a regex to remove data url part
      const base64String = imgReader.result
        .replace('data:', '')
        .replace(/^.+,/, '');
      const img = new Image();
      img.src = evt.target.result;
      img.onload = function handleImageLoad() {
        const imgWidth = this.naturalWidth;
        const imgHeight = this.naturalHeight;
        const widthRatio = maxImageWidth / imgWidth;
        const heightRatio = maxImageHeight / imgHeight;
        const bestRatio = Math.min(widthRatio, heightRatio);
        const newWidth = imgWidth * bestRatio;
        const newHeight = imgHeight * bestRatio;
        const imgOffset = Number.parseInt((newWidth - newHeight) * 0.5, 10);

        const lostPetText = getCkeckedRadioValue(typeRadioGroup) === 'Dog' ? lostDogText : getCkeckedRadioValue(typeRadioGroup) === 'Cat' && lostCatText;
        doc.setLineWidth(2);
        doc.rect(10, 10, doc.internal.pageSize.width - 20, doc.internal.pageSize.height - 20, 'S');
        doc.addImage(lostPetText, 'JPEG', 25, 20, 160, 28);
        doc.addImage(base64String, 'JPEG', 65 - imgOffset, 50, newWidth, newHeight);
        doc.setTextColor('#000000');
        doc.setFontSize(55);
        doc.setFont('helvetica', 'bold');
        doc.text(petName.value.toString().toUpperCase(), 105, 150, 'center');
        doc.setTextColor('#000000');
        doc.setFontSize(20);
        doc.setFont('helvetica', 'normal');
        const splitPetDetails = doc.splitTextToSize(`${petAge.value.toString()} YEAR OLD ${petColor.value.toString().toUpperCase()} ${getCkeckedRadioValue(genderRadioGroup).toUpperCase()} ${petBreed.value.toString().toUpperCase()}.`, 180);
        doc.text(splitPetDetails, 105, 160, 'center');
        doc.setTextColor('#000000');
        doc.setFontSize(20);
        doc.setFont('helvetica', 'normal');
        const splitAddress = doc.splitTextToSize(`LAST SEEN ${address.value.toString().toUpperCase()}, ${city.value.toString().toUpperCase()}`, 180);
        doc.text(splitAddress, 105, 185, 'center');
        doc.setTextColor('#000000');
        doc.setFontSize(16);
        doc.setFont('helvetica', 'normal');
        doc.text('- - - - - - - - - - -', 105, 200, 'center');
        doc.setTextColor('#000000');
        doc.setFontSize(16);
        doc.setFont('helvetica', 'normal');
        const splitText = doc.splitTextToSize(addInfo.value.toString(), 180);
        doc.text(splitText, 105, 205, 'center');
        const textDim = doc.getTextDimensions('Text');
        doc.rect(35, 217 + textDim.h, 140, 30, 'F');
        doc.setTextColor('#FFFFFF');
        doc.setFontSize(40);
        doc.setFont('Helvetica', 'bold');
        doc.text(`CALL ${phone.value.toString()}`, 105, 234 + textDim.h, 'center');
        doc.setFontSize(18);
        doc.text(email.value.toString(), 105, 240 + textDim.h, 'center');
        doc.addImage(petWatchLogo, 30, 249 + textDim.h, 160, 30);

        doc.save('lostpetposter.pdf');
      };
    };
    imgReader.readAsDataURL(file);

    return true;
  }

  // Generate poster button
  generatePosterBtn.addEventListener('click', () => {
    // Allowing file type
    const allowedExtensions = /(\.jpg|\.jpeg|\.png)$/i;
    const imgFileValue = fileInput.value;

    if (imgFileValue !== '') {
      if (!allowedExtensions.exec(imgFileValue)) {
        // eslint-disable-next-line no-alert
        window.alert('Photo image should be either JPEG(*.jpg, *.jpeg) or PNG(*.png).');
        fileInput.value = '';
        fileInput.dispatchEvent(new Event('change'));
      } else if (parseFloat((fileInput.files[0].size / (1024 * 1024)).toFixed(2)) > 2) {
        // eslint-disable-next-line no-alert
        window.alert('Photo image should be either JPEG(*.jpg, *.jpeg) or PNG(*.png) and less than 2 MB in size.');
      } else {
        generatePDF();
      }
    } else {
      // eslint-disable-next-line no-alert
      window.alert('Photo image should be either JPEG(*.jpg, *.jpeg) or PNG(*.png).');
    }
  });
}
